class TimeSuite:
    def time_max_trials_greater_than_full(self):
        run_with_args([self.script, "x=[1,2]", "y=[2,3]", "--max-trials", "5"])

    def setup(self):
        self.script = os.path.join(os.getenv("ASV_BUILD_DIR", ""), str(uuid.uuid4())+".py")
        with open(self.script, "w") as f:
            f.write("x=1\n")
            f.write("y=2\n")
            f.write("print(x+y)\n")

